import React from 'react'
import { Feature } from '../components/header/styles/header';
import { HeaderContainer } from '../containers/header'


export default function Home() {
    return (
        <>
            <HeaderContainer>
                <Feature>
                    <Feature.Title>영화,TV 프로그램을 무제한으로.</Feature.Title>
                </Feature>
            </HeaderContainer>
        </>
    );
}
